script: |
  super -f text -I q323.spq | sort > q323.out

inputs:
  - name: q323.spq
    data: |
      SELECT (a+b+c+d+e)/5
      FROM t1 (FORMAT parquet)
      WHERE c BETWEEN b-2 AND d+2
      AND a IS NULL
      AND d NOT BETWEEN 110 AND 150;
  - name: t1

outputs:
  - name: q323.out
    data: |
      -
